"use strict";(self.webpackChunksolide_docs=self.webpackChunksolide_docs||[]).push([[849],{6164:e=>{e.exports=JSON.parse('{"version":{"pluginId":"default","version":"current","label":"Next","banner":null,"badge":false,"noIndex":false,"className":"docs-version-current","isLast":true,"docsSidebars":{"tutorialSidebar":[{"type":"link","label":"\ud83d\udc4b Introduction","href":"/docs/intro","docId":"intro","unlisted":false},{"type":"link","label":"\u26d3\ufe0f Support Chains","href":"/docs/supported-chains","docId":"supported-chains","unlisted":false},{"type":"category","label":"\ud83d\udca1 Solide IDEs","collapsible":true,"items":[{"type":"category","label":"\ud83d\udfe3 Solide","items":[{"type":"link","label":"Import Contract Address","href":"/docs/ide/sol-ide-contract","docId":"ide/sol-ide-contract","unlisted":false},{"type":"link","label":"Import Github Repository","href":"/docs/ide/sol-ide-github","docId":"ide/sol-ide-github","unlisted":false}],"collapsed":true,"collapsible":true},{"type":"link","label":"\ud83d\udfe1 Movide","href":"/docs/ide/move-ide","docId":"ide/move-ide","unlisted":false},{"type":"link","label":"\ud83d\udfe2 Swayide","href":"/docs/ide/sway-ide","docId":"ide/sway-ide","unlisted":false},{"type":"link","label":"\ud83d\udd35 Stylide","href":"/docs/ide/stylus-ide","docId":"ide/stylus-ide","unlisted":false},{"type":"link","label":"\ud83d\udd35 Aspectide (Coming Soon)","href":"/docs/ide/aspect-ide","docId":"ide/aspect-ide","unlisted":false}],"collapsed":true},{"type":"category","label":"\ud83c\udf93 Proof of Learn","collapsible":true,"items":[{"type":"link","label":"Introducation","href":"/docs/pol/intro","docId":"pol/intro","unlisted":false},{"type":"link","label":"PoL POAP","href":"/docs/pol/poap","docId":"pol/poap","unlisted":false},{"type":"category","label":"Course","items":[{"type":"link","label":"quest.config.json","href":"/docs/pol/course/config","docId":"pol/course/config","unlisted":false},{"type":"link","label":"Course POAP","href":"/docs/pol/course/poap","docId":"pol/course/poap","unlisted":false},{"type":"link","label":"Publish on PoL","href":"/docs/pol/course/apply","docId":"pol/course/apply","unlisted":false}],"collapsed":true,"collapsible":true},{"type":"category","label":"Quest","collapsible":true,"items":[{"type":"link","label":"Deployment","href":"/docs/pol/quest/deployment","docId":"pol/quest/deployment","unlisted":false},{"type":"link","label":"Transaction","href":"/docs/pol/quest/transaction","docId":"pol/quest/transaction","unlisted":false}],"collapsed":true}],"collapsed":true},{"type":"category","label":"\u2699\ufe0f Tools","collapsible":true,"items":[{"type":"link","label":"\ud83d\udd0c Web3 Plugin Contracts","href":"/docs/tools/web3-contract-plugin","docId":"tools/web3-contract-plugin","unlisted":false}],"collapsed":true},{"type":"category","label":"Socials","collapsible":false,"collapsed":false,"items":[{"type":"link","label":"\u2b50 X (Twitter)","href":"https://x.com/SolideProject"},{"type":"link","label":"\u2b50 Proof of Learn (Twitter)","href":"https://x.com/0xProofOfLearn"},{"type":"link","label":"\u2b50 Github","href":"https://github.com/solide-project"}]}]},"docs":{"ide/aspect-ide":{"id":"ide/aspect-ide","title":"Aspectide (Coming Soon!)","description":"AspectIDE is a cutting-edge integrated development environment (IDE) designed to streamline the development of smart contracts across multiple blockchain platforms. With its robust and intuitive interface, AspectIDE provides developers with powerful tools for writing, testing, and deploying smart contracts seamlessly. The IDE supports a range of blockchain languages and standards, offering features such as real-time syntax highlighting, automated code completion, and integrated debugging. AspectIDE aims to enhance productivity and simplify the development process, making it easier for developers to build and manage their blockchain projects efficiently.","sidebar":"tutorialSidebar"},"ide/move-ide":{"id":"ide/move-ide","title":"Movide","description":"Movide is an online Integrated Development Environment (IDE) that redefines Move programming for blockchain networks such as Movement and SUI. It is designed to streamline Move development by providing a simple, lightweight UI packed with feature-rich tools. Much like Remix for Solidity, Movide brings a dedicated Move-based IDE to the browser, enabling seamless compiling, building, and deploying of Move packages on-chain. What sets Movide apart is its unique ability to load Move packages directly from GitHub or verified on-chains packages into the IDE, facilitating a novel solution for developers aiming to deploy on Movement.","sidebar":"tutorialSidebar"},"ide/sol-ide-contract":{"id":"ide/sol-ide-contract","title":"Import a contract address in Solide","description":"This document provides instructions on how to load a verified smart contract directly from a chain using an iframe or via SolideIDE.","sidebar":"tutorialSidebar"},"ide/sol-ide-github":{"id":"ide/sol-ide-github","title":"Import a Solidty from Github to Solide","description":"This document provides instructions on how to load a smart contract directly from GitHub using an iframe or via SolideIDE.","sidebar":"tutorialSidebar"},"ide/stylus-ide":{"id":"ide/stylus-ide","title":"Stylide","description":"Stylide is an advanced web-based Integrated Development Environment (IDE) designed for Stylus smart contracts. Tailored for developers working with the Stylus blockchain, Stylide offers a streamlined and intuitive interface that enhances the smart contract development process. It provides essential tools for writing, compiling, and deploying Stylus contracts directly from the browser. With features similar to those found in established IDEs like Remix for Solidity, Stylide supports seamless integration with blockchain networks, enabling efficient contract management and deployment. Its unique capabilities include loading and interacting with Stylus contracts, offering developers a robust platform for building and testing smart contracts in the Stylus ecosystem.","sidebar":"tutorialSidebar"},"ide/sway-ide":{"id":"ide/sway-ide","title":"Swayide","description":"SwayIDE is a specialized Integrated Development Environment designed for developing Sway smart contracts on the Fuel blockchain. It provides a user-friendly interface that facilitates writing, compiling, and deploying Sway contracts with ease. Featuring integrated support for project management and deployment, SwayIDE streamlines the development workflow, offering tools for real-time code analysis, error checking, and network configuration. With built-in support for various Fuel networks, including devnet, testnet, and mainnet, SwayIDE enhances the efficiency of smart contract development and deployment processes, making it a valuable tool for developers working within the Fuel ecosystem.","sidebar":"tutorialSidebar"},"intro":{"id":"intro","title":"Introduction","description":"Solide is an open source lightweight, web-based Solidity Integrated Development Environment (IDE) and educational smart contract hub that for developers, educators, and blockchain enthusiasts. Solide offers an intuitive and feature-rich platform designed to empower you on ones journey into blockchain development. By supporting various blockchains and protocols, including Ethereum, Chainlink, OpenZeppelin, and many more, Solide provides a comprehensive platform for constructing, utilizing, and exploring smart contracts. Its user-friendly IDE, capable of seamless integration with tutorials and demos, facilitates an interactive learning environment. Solide\'s overarching goal is to serve as both an educational tool and a developer tool, promoting practical understanding and development across the Ethereum ecosystem.","sidebar":"tutorialSidebar"},"pol/course/apply":{"id":"pol/course/apply","title":"Contribution","description":"","sidebar":"tutorialSidebar"},"pol/course/config":{"id":"pol/course/config","title":"quest.config.json","description":"The quest.config.json serves as the configuration blueprint for defining and managing quests in the Proof of Learn platform. It provides a structured format for specifying key metadata, such as the quest\'s title, description, prerequisites, and any associated quests. This configuration ensures that quests are easily deployable, maintainable, and compatible with the platform\'s dynamic questing system. By using quest.config.json, creators can streamline the setup of interactive and engaging learning experiences while maintaining consistency and scalability with their blockchain and smart contracts.","sidebar":"tutorialSidebar"},"pol/course/poap":{"id":"pol/course/poap","title":"Course POAP","description":"PoL POAPs are the rewarding protocol for recognizing achievements on the Proof of Learn platform. Using the ERC-1155 token standard, each POAP serves as a unique, verifiable badge for learners who complete courses. These tokens are minted on-chain, ensuring permanence and easy verification. Each POAP includes an image and metadata, providing a visual and contextual representation of the learner\'s accomplishment.","sidebar":"tutorialSidebar"},"pol/intro":{"id":"pol/intro","title":"Proof of Learn: Interactive Web3 Learning","description":"Proof of Learn (PoL) is an interactive, blockchain-powered platform redefining Web3 education through hands-on learning. Instead of passive quizzes, PoL immerses users in real-world tasks like deploying smart contracts and completing on-chain transactions, with progress verified directly on-chain. Learners earn blockchain-validated PoL POAP NFTs as tangible proof of their achievements. Built on Open Campus, PoL fosters transparency, collaboration, and open-source innovation, making it the ultimate hub for mastering Web3 concepts across diverse ecosystems.","sidebar":"tutorialSidebar"},"pol/poap":{"id":"pol/poap","title":"Proof of Active Participation","description":"The PoL POAP (Proof of Active Participation) NFT is a digital awarded to learners for their active participation and achievements in the Proof of Learn platform. It serves as a verified, on-chain record of their progress, showcasing their commitment to acquiring new knowledge and completing educational milestones.","sidebar":"tutorialSidebar"},"pol/quest/deployment":{"id":"pol/quest/deployment","title":"Quest Deployment","description":"","sidebar":"tutorialSidebar"},"pol/quest/transaction":{"id":"pol/quest/transaction","title":"Quest Transaction","description":"","sidebar":"tutorialSidebar"},"supported-chains":{"id":"supported-chains","title":"Support Chains","description":"Solide IDE aims to support a wide range of blockchain protocols and ecosystems. Support Chains are designed to enhance your development experience by providing comprehensive assistance in loading and exploring verified smart contracts different blockchain networks and protocols. The following is an overview of the supported chains and protocols in Solide IDE, with more to be added in the future.","sidebar":"tutorialSidebar"},"tools/awesome-solidity-learn":{"id":"tools/awesome-solidity-learn","title":"Awesome Learn Solidity [![Awesome](https://cdn.rawgit.com/sindresorhus/awesome/d7305f38d29fed78fa85652e3a63e154dd8e8829/media/badge.svg)](https://github.com/sindresorhus/awesome)","description":"A collection of awesome Solidity resources and guides."},"tools/solidity-database":{"id":"tools/solidity-database","title":"Solidity Database","description":"Decentralised Open Source Contract Explorer."},"tools/web3-contract-plugin":{"id":"tools/web3-contract-plugin","title":"Web3 Plugin Contracts","description":"Contract Plugin for Web3.js.","sidebar":"tutorialSidebar"}}}}')}}]);